import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

import Home from './pages/home/Home';
import List from './pages/list/List';
import Login from './pages/login/Login'
import New from './pages/new/New'
import Single from './pages/single/Single'

function App() {
  return (
    <div className="App">
      <Home />
      <List />
      <Login />
      <New />
      <Single />
    </div>
  );
}

export default App;
